import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../footer.css'
export default function Footer() {
  return (
    <>
     <Container>
      <Row>
      <Col style={{ height: '200px', backgroundColor: 'black'}}>1 of 3</Col>
        <Col style={{ height: '200px', backgroundColor: 'red' }}>2 of 3</Col>
        <Col style={{ height: '200px', backgroundColor: 'green' }}>3 of 3</Col>
      </Row>
    </Container>
  </>
  )
}
